function HomePage(){
    return (
        <div className="nbank">
            <div className="jumbotron bg-transparent text-white p-4 text-center border-bottom">
                <h4>Welcome to Online Smart Banking System</h4>    
            </div>
            <div className="container">
                <div >
                    <div className="col-9 mx-auto text-center">
                        <div >
                            <button style={{width:"40px"}}className="btn btn-primary" onClick={()=>window.location.href='/login'}>Login</button> &nbsp; &nbsp;&nbsp;
                            <button className="btn btn-primary" onClick={()=>window.location.href='/register'}>Register</button>
                        </div>
                    </div>
                </div>
            </div>
        </div>
        )
    }
export default HomePage;
